def find_most_frequent_char(input_string):
    char_frequency = {}
    for char in input_string:
        if char not in char_frequency:
            char_frequency[char] += 1
        else:
            char_frequency[char] = 1
    most_frequent_char = max(char_frequency, key=char_frequency.get)
